import Header from './components/Header';
import Footer from './components/Footer';
// import './App.css'; // Comment this out if not using App.css

const App = () => {
  return (
    <div className="App">
      <Header />
      <main>
        <h1>Welcome to the AI Business Intelligence App</h1>
        {/* Main content */}
      </main>
      <Footer />
    </div>
  );
};

export default App;
